    var outgoing_number = "{{ $rfa->outgoing_number }}";
    var outgoing_date = "{{ $rfa->outgoing_date }}"
    var note_4 = "{{ $rfa->note_4 }}";
    var comment_status = "{{$rfa->comment_status->name }}";
    var for_status = "{{ $rfa->for_status->name }}";


    //////// Panel A ////////
    //Head
    doc.text(170,11,rfa_code);
    //Name
    doc.text(24,54,title_th);
    doc.text(24,62,title_en);
    //Doc. code
    doc.text(123,49,document_number);
    doc.text(172,49,rfa_code);
    //Date
    doc.text(123,58,submit_date);
    //Assign / WBS
    doc.text(30,67,assign_to);
    doc.text(60,80,wbs);
    //Note1
    doc.text(40,94,note_1);
    //Issue
    doc.text(75,107,issue_by);
    
    //////// Panel B ////////
    //Incoming
    doc.text(133,121,incoming_number);
    doc.text(123,126,receive_date);
    //Note2
    doc.text(40,157,note_2);
    //Assign
    doc.text(75,171,assign_to);
    //Distribute Date
    doc.text(148,174,distribute_date);

    //////// Panel C ////////
    if(comment_status == "Approve"){
        doc.setFontSize(14);
        doc.text(60,196,check); //60
        doc.setFontSize(9);
    }
    else if(comment_status == "Approve as Note"){
        doc.setFontSize(14);
        doc.text(90,196,check); //90
        doc.setFontSize(9);
    }
    else if(comment_status == "Re-Submit"){
        doc.setFontSize(14);
        doc.text(119,196,check); //119
        doc.setFontSize(9);
    }
    else if(comment_status == "Not Acceptable"){
        doc.setFontSize(14);
        doc.text(145,196,check); //145
        doc.setFontSize(9);
    }
    else{

    }


    //Note3
    doc.text(40,204,note_3);
    //Action
    doc.text(75,217,action_by);
    //Process Date
    doc.text(148,216,process_date);

    //////// Panel D ////////

    if(for_status == "Approve"){
        doc.setFontSize(14);
        doc.text(60,241,check); //60
        doc.setFontSize(9);
    }
    else if(for_status == "Approve as Note"){
        doc.setFontSize(14);
        doc.text(90,241,check); //90
        doc.setFontSize(9);
    }
    else if(for_status == "Re-Submit"){
        doc.setFontSize(14);
        doc.text(119,241,check); //119
        doc.setFontSize(9);
    }
    else if(for_status == "Not Acceptable"){
        doc.setFontSize(14);
        doc.text(145,241,check); //145
        doc.setFontSize(9);
    }
    else{

    }

    doc.text(40,249,note_4);
    doc.text(148,262,outgoing_date);
    doc.text(75,262,assign_to);
    doc.text(133,229,outgoing_number);
    doc.text(123,233,outgoing_date);





    var string = doc.output('datauristring');
